import React from 'react';
import './ProfileCard.css';

const ProfileCard = () =>{
    return(
        <div className="container-fluid">
            <div className="card-container">
                <div className="card">
                    <h3 className="card-title">User Name</h3>
                    <p className="card-description">
                        Welcome
                    </p>
                </div>
            </div>
        </div>
    );
};

export default ProfileCard;
